original_question:
Dvanaest kvadrata veličine 1 puta 1 tvore pravokutnik, kao što je prikazano. Koja je ukupna površina zasjenčenog područja? [asy]
size(4cm);defaultpen(linewidth(0.75));

// Ispunjeni dijelovi
fill((0, 4)--(0, 0)--(2, 0)--cycle, gray(0.75));
fill((0, 4)--(3, 4)--(3, 0)--cycle, gray(0.75));

// mreža
int j;
for (j = 0; j < 4; ++j) {draw((j, 0)--(j, 4));}
for (j = 0; j < 5; ++j) {draw((0, j)--(3, j));}

//dijagonale
draw((0, 4)--(3, 0)); draw((0, 4)--(2, 0));
[/asy]

